import React from 'react';


function Loading() {

  const style = {
    width: "100%",
    height: "500px",
    backgroundColor: "rgba(0,0,0,0.1)"

  }
  return (
    <div style={style} className="spinner-grow text-muted">
      <i style={{ marginLeft: "45%", marginTop: "15%" }} className="fa4x fa fa-spinner fa-spin" />
    </div>
  );
}

export default Loading;
